import {web} from "...src//Images/img.jpg";
//import { NavLink } from "react-router-dom";
import Common from "./Common";
 
const About = ()=>{
    return(
        <>
        <Common 
        name="welcom to about"
         imgsrc={web} 
         visite="/contact"
          btname="contact now"/>
        </>
        );
    };
    export default  About;
